import React from 'react';
//import logo from './logo.svg';
//import './App.css';

function Hello() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="http://xammin.com/wp-content/uploads/2018/10/Xammin-Logo.png" className="App-logo" alt="logo" />
        <p>
          Hello World
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default Hello;
